import React from 'react';
import './Main.css';
import { Link } from "react-router-dom";
import Game from './Game'
import Comm from './Comm'
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';
import Slider from '@mui/material/Slider';
import MuiInput from '@mui/material/Input';


function Main(prop) {
  const components = {
    Game: Game,
    Comm: Comm
  };
  const Test = components[prop.content];

  const [value, setValue] = React.useState(30);

  const handleSliderChange = (event, newValue) => {
    setValue(newValue);
  };

  const handleInputChange = (event) => {
    setValue(event.target.value === '' ? '' : Number(event.target.value));
  };

  const handleBlur = () => {
    if (value < 0) {
      setValue(0);
    } else if (value > 100) {
      setValue(100);
    }
  };


  return (
    <div>

      <div id="page-wraper">
        <div className="responsive-nav">

          <div id="menu" className="menu">

            <div className="container">
              <div className="image">
                <a href="#"><img alt="main_logo" src="img/logo.png" /></a>
              </div>
              <div className="author-content">
                <h4>Filter</h4>

                <br></br>
                <br></br>

              </div>
              <nav className="main-nav" role="navigation">
                <ul className="main-menu">
                  <li><a href="#section1">About Me</a></li>
                  <li><a href="#section2">What I’m good at</a></li>
                  <li><a href="#section3">My Work</a></li>
                  <li><a href="#section4">Contact Me</a></li>
                </ul>
              </nav>


            </div>
          </div>
        </div>

        <section className="section about-me" data-section="section1">
          <div className="container">
            <div className="section-heading">
              <Link to="/Login"><button>sign in sign up</button></Link>
            </div>
            <div className="topNav">
              <div className="topnav">
                <Link to="/">Game</Link>
                <Link to="/Comm">Community</Link>
              </div>
            </div>
            <Test></Test>
          </div>
        </section>

      </div>

    </div>
  );
}

export default Main;
